package learn.mt.pspmard.ajcp.conchashmap.model;import java.util.HashSet;import java.util.Objects;import java.util.Set;public class Movie {    private final String title;    private final int releaseYear;    private final Set<Actor> actors = new HashSet<>();    public Movie(String title, int releaseYear) {        this.title = title;        this.releaseYear = releaseYear;    }    public void addActor(Actor actor) {        actors.add(actor);    }    public Set<Actor> actors() {        return actors;    }    @Override    public String toString() {        return "Movie{" + "title=" + title + ", releaseYear="                + releaseYear + ", actors=" + actors + '}';    }        @Override    public int hashCode() {        int hash = 7;        hash = 67 * hash + Objects.hashCode(title);        return hash;    }    @Override    public boolean equals(Object obj) {        if (obj == null) {            return false;        }        if (getClass() != obj.getClass()) {            return false;        }        final Movie other = (Movie) obj;        return Objects.equals(title, other.title);    }}